import React from 'react'
import FlightItem from './FlightItem'
import Panel from "./Panel"
import Text from './Text'

export default function FlightList() {

    const flights = [
        {
            from: "AUS",
            to: "JFK",
            type: "Airbus 320",
            price: "300",
            time: 4
        },
    ]

    return <Panel style={{marginRight: "1em", flex: 2}}>
        <div style={{display: "flex", alignItems: "flex-end"}}>
            <Text>Ongoing Bids</Text>
            <Text>| Completed Bids</Text>
        </div>
        {flights.map(flight => <FlightItem data={flight} />)}
    </Panel>
}
